import math

def unique_prime_numbers(numbers):
    primes = set()
    for num in numbers:
        is_prime = False
        if num <= 1:
            is_prime = False
        else:
            for i in range(2, int(math.sqrt(num)) + 1):
                if num % i == 0:
                    is_prime = False
                    break
        if is_prime:
            primes.add(num)
    return sorted(list(primes))

